import React from 'react';
import { SideBar } from '../component';

const Main = () => {
    return (<>
        <main>
            <div className="container-fluid" id="mainContainer">
                <div className="row">
                    <SideBar />
                </div>
            </div>
        </main>
    </>);
}

export default Main;
